Verenigd Koninkrijk
Actie / Misdaad
101 minuten

goeie film en een goed verhaal

met Sean Bean, Bob Hoskins en Rupert Friend

Wanneer parachutist Bryant terugkomt van een missie in Irak is hij geshockeerd door wat hij ziet. Hij herkent zijn eigen land niet meer. Als hij dan ook nog wordt ontslagen uit het leger besluit hij, om samen met enkele anderen, een groepering te beginnen. Door middel van keihard optreden willen ze de straten schoon vegen!:
